import apiPath from '../../Filepaths';

export default {
    name: 'Winkels',
    data() {
        return {
            selected: '',
            winkels: [],
            producten: [],
        };
    },

    mounted() {
        this.fetchWinkels()
    },

    methods: {
        async fetchWinkels() {
            const response = await fetch(`${apiPath}product`);
            this.winkels = await response.json();
        },

        async fetchProducten(winkel) {
            const response = await fetch(`${apiPath}product/`)
            this.producten = await response.json();
        },
    }
};
